import React from 'react'; 
import PostForm from '../components/PostForm'
import PostCard from '../components/PostCard'


const Home = ()=>{

    return (
            <div>
                {dummy.isLoggedIn && <PostForm />}
                {dummy.mainPosts.map((v,i)=>{
                    return (
                            <PostCard key={v}/>
                    )
                })}
            </div>
        )

}

export default Home;
